import React from "react";
import { Box, Typography } from "@mui/material";
import { DetailsOutlined } from "@mui/icons-material";

const Tab = ({ icon, details }) => {
  return (
    <>
      <Box
        sx={{
          bgcolor: "#000000",
          color: "#ffffff",
          height: "100%",
          border: 2,
          borderColor: "#ffffff",
          borderRadius: 1,
          boxShadow: 3,
          display: "flex",
          flexDirection: "column",
          justifyContent: "Center",
          alignItems: "center",
        }}
      >
        {icon}
        <Typography variant="h6" align="center">
          {details}
        </Typography>
      </Box>
    </>
  );
};

export default Tab;
